import React, { useRef, useState, useEffect } from "react";
import swal from "sweetalert";
import {useParams} from "react-router-dom";

import * as tf from "@tensorflow/tfjs";
import * as handpose from "@tensorflow-models/handpose";
import Webcam from "react-webcam";
import Cam from "../components/webcam";
import { drawHand } from "../utilities";

import * as fp from "fingerpose";
import Handsigns from './handsigns'
import {Signimage,Signpass} from './handimage'
import NavBar from "../components/navbar";

function App(props) {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);
 
  const {letter}=useParams() 
  
 
 
 
  return (
    <div className="Appx" style={{backgroundColor:"black"}}>
      <NavBar/>
      <h1>Practice Letter {letter}</h1>
      <header className="App-header" style={{padding:"2%"}}>
      <p>{!data ? "Loading..." : data}</p>
      <Cam letter={letter}/>
   <div >
          {letter!=null ? (<img
            src={Signpass[letter].src}
            style={{
              position: "absolute",
              marginLeft: "auto",
              marginRight: "auto",
              width:500,
              backgroundColor:"white",
            left: 0,
              textAlign: "center",
              height: 480,
              zIndex:9
            }}
          />):(
            ""
          )
         
}
</div>

       
      </header>
    </div>
  );
}

export default App;
